function App() {
const [data, setData] = useState ([])

useEffect(() => {

const apiFetchData = async () => {
  const response = await fetch (apiURL);
  console.log(response)
  const data = await response.json();

  console.log(data,"DATA DATA")
  setData(data)

}



  apiFetchData();
  }, [])



  return 
    <div className="App">

      <h1>
        STRANGER THINGS APP !
      </h1>
      {
      data.map((data, idx) => {
        return <div key={idx}>
          <p>{data.posts}</p>
        </div>
      })
    }

    </div>

}


